class InputgroupComponent {
    constructor(elRef, renderer) {
        this.elRef = elRef;
        this.renderer = renderer;
        this.hint = '';
        this.type = 'text';
        this.value = '';
        this.size = 'lg';
        this.material = false;
        this.background = false;
        this.disabled = false;
        this.name = '';
    }
    ngOnInit() {
        this.renderer.removeAttribute(this.elRef.nativeElement, 'class');
        this.renderer.removeAttribute(this.elRef.nativeElement, 'style');
    }
    ngAfterViewInit() {
        /**************** Dynamic Classes and ID  ******************/
        this.renderer.addClass(this.CDBInput.inputContainer.nativeElement, 'input-group');
        if (this.inputGroupClass) {
            let classes = this.inputGroupClass.split(' ');
            classes.forEach((className) => {
                this.renderer.addClass(this.CDBInput.inputContainer.nativeElement, className);
            });
        }
        if (this.prependClass) {
            let classes = this.prependClass.split(' ');
            classes.forEach((className) => {
                this.renderer.addClass(this.inputGroupPrepend.nativeElement, className);
            });
        }
        if (this.appendClass) {
            let classes = this.appendClass.split(' ');
            classes.forEach((className) => {
                this.renderer.addClass(this.inputGroupAppend.nativeElement, className);
            });
        }
        if (this.id) {
            this.renderer.setAttribute(this.CDBInput.inputContainer.nativeElement, 'id', this.id);
        }
        /******************************************/
        /************** Input Group ***************/
        if (this.material === true) {
            this.renderer.addClass(this.CDBInput.inputContainer.nativeElement, 'md-form');
        }
        if (this.size) {
            this.renderer.addClass(this.CDBInput.inputContainer.nativeElement, `input-group-${this.size}`);
        }
        /******************************************/
    }
}
